import React, { useState } from 'react';
import DashboardLayout from './DashboardLayout';
import MarketDataTab from './components/MarketDataTab';
import NewsTab from './components/NewsTab';
import SECFilingsTab from './components/SECFilingsTab';
import SocialSentimentTab from './components/SocialSentimentTab';
// Add more imports for other agent tabs as needed

const tabComponents = {
  market: <MarketDataTab />,
  news: <NewsTab />,
  sec: <SECFilingsTab />,
  sentiment: <SocialSentimentTab />,
  macro: <div>Macro Data Coming Soon</div>,
  events: <div>Company Events Coming Soon</div>,
  startup: <div>Startup Signals Coming Soon</div>,
  nlp: <div>NLP Extraction Coming Soon</div>,
};

function App() {
  const [selectedKey, setSelectedKey] = useState('market');
  return (
    <DashboardLayout selectedKey={selectedKey} onMenuChange={setSelectedKey}>
      {tabComponents[selectedKey]}
    </DashboardLayout>
  );
}

export default App;
